import {Field} from "redux-form";

const Feedback=({feedback})=>{

    let FeedBackElements= feedback.map(fbe=><div key={fbe.id}>
        <span>{fbe.name}</span><span>{fbe.feedBack}</span>
    </div>)
    return<div>feedback
    <div>
        {FeedBackElements}
    </div>
    </div>
}

const FeedBackForm=()=>{
    return<form>
        <Field component={"input"} />
    </form>
}


export default Feedback
